package redis

import (
	"davinci/common/log"
	"fmt"
)

var LINUX_X64_MODULE_HEX = ""
var LINUX_X86_MODULE_HEX = ""
var LINUX_ARM64_MODULE_HEX = ""

var RedisModuleMap = map[string]string{
	"linux_x86_64":  LINUX_X64_MODULE_HEX,
	"linux_i386":    LINUX_X86_MODULE_HEX,
	"linux_i686":    LINUX_X86_MODULE_HEX,
	"linux_aarch64": LINUX_ARM64_MODULE_HEX,
}

func GetRedisModule(os, platform string) string {
	log.Info(fmt.Sprintf("os: %s , platform: %s, ", os, platform))

	moduleHex := RedisModuleMap[fmt.Sprintf("%s_%s", os, platform)]
	if moduleHex == "" {
		log.Warn("no udf found for the os and platform")
	}
	return moduleHex
}
